let All_Properties = collections['4830d9c8-536f-4e8d-8407-0b262420519c']?.data || [];
if (!Array.isArray(All_Properties) || All_Properties.length === 0) {
  alert("لا توجد عقارات للتصدير");
  return;
}

const headers = [
  "عنوان العقار",
  "حالة العقار",
  "مستوى التشطيب",
  "الموظف المسئول",
  "موقع العقار",
  "نوع العقار",
  "السعر",
  "المساحة م/مربع",
  "الدور",
  "غرف النوم",
  "الحمام",
  "مميزات العقار"
];

const rows = All_Properties.map(property => {
  const statusName = property.property_status?.status_name || `ID ${property.property_status}`;
  const propertyFinishing = property.property_finishing?.finishing_name || `ID ${property.property_finishing}`;
  const userName = property.profiles?.user_name || `ID ${property.user_id}`;

  return [
    property.property_title || "",
    statusName,
    propertyFinishing,
	userName,
	property.location || "",
	property.property_type || "",
	property.price || "",
	property.area || "",
	property.floor || "",
	property.bedrooms || "",
	property.bathrooms || "",
	property.features || "",
  ];
});

const csvContent = [
  headers.join(","),
  ...rows.map(row => row.map(value => `"${value}"`).join(","))
].join("\n");

const BOM = "\uFEFF";
const blob = new Blob([BOM + csvContent], { type: "text/csv;charset=utf-8;" });
const url = URL.createObjectURL(blob);
const link = document.createElement("a");
link.setAttribute("href", url);
link.setAttribute("download", "All_Properties_Export.csv");
link.click();

